import React, { Component } from 'react';

class Header extends Component {
    render() {
        return (
            <div className="header">
                <video className ="main-video">
                    <source src="../static/ball.mp4" type="video/mp4"></source>
                </video>
            </div>
        );
    }
}

export default Header;
